  false,\n\t\"url\": null,\n\t\"notes\": \"The data (15,904 records documenting 9,090
  worldwide gravity base stations) were gathered by various governmental organizations
  (and academia) using a variety of methods. This data base was received in August
  1993. Principal gravity parameters include station id and observed gravity. The
  observed gravity values are referenced to the International Gravity Standardization
  Net 1971 (IGSN 71) and the gravity anomalies are computed using the World Geodetic
  System 1984 (WGS 84) theoretical gravity formula. The spatial resolution of the
  data is randomly distributed throughout the world. Note that the dmanet93.bin file
  contains only the station name for each of the 9,090 stations. The complete listing
  for each station(including any supplementary records), are contained in the ASCII
  file named dmanet93.asc.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
